create database if not exists gamedb;
create database if not exists logdb;

use gamedb;

DROP TABLE IF EXISTS `players`;
CREATE TABLE `players` (
  `PlayerID` int(11) unsigned NOT NULL COMMENT '角色ID',
  `DeviceID` varchar(41) NOT NULL DEFAULT '' COMMENT '昵称',
  `NotifyID` varchar(65) NOT NULL DEFAULT '',
  `UserName` varchar(32) NOT NULL DEFAULT '',
  `DispName` varchar(41) NOT NULL DEFAULT '',
  `Pay` int(11) unsigned NOT NULL DEFAULT '0',
  `VipLevel` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT 'VIP等级',
  `Gold` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '元宝',
  `Coin` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '铜钱',
  `Phystrength` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '体力',
  `Science` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '器魂',
  `Story` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '阅历',
  `JingJie` bigint(20) unsigned NOT NULL DEFAULT '0',
  `BlueGas` bigint(20) unsigned NOT NULL DEFAULT '0',
  `PurpleGas` bigint(20) unsigned NOT NULL DEFAULT '0',
  `StudyExp` bigint(20) unsigned NOT NULL DEFAULT '0',
  `BagOpenNum` tinyint(4) unsigned NOT NULL DEFAULT '0',
  `GuideRecordData` varbinary(300) NOT NULL DEFAULT '',
  `Firstattack` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '先攻',
  `Power` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '战力',
  `MainHeroKindID` smallint(6) unsigned NOT NULL DEFAULT '0',
  `Level` smallint(6) unsigned NOT NULL DEFAULT '0',
  `Rank` int(10) unsigned NOT NULL DEFAULT '0',
  `CaptureOwnerID` int(10) unsigned NOT NULL DEFAULT '0',
  `BeCaptureOwnerTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `OpenPlunder` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `LastOrderID` varchar(128) NOT NULL DEFAULT '',
  `RobotFunc` tinyint(4) unsigned NOT NULL DEFAULT '0',
  `AllOnlineTime` int(10) unsigned NOT NULL DEFAULT '0',
  `Silence` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '1禁言',
  `EatBreadNotify` tinyint(4) NOT NULL DEFAULT '0',
  `BossBattleNotify` tinyint(4) NOT NULL DEFAULT '0',
  `CourageNofity` tinyint(4) NOT NULL DEFAULT '0',
  `Version` int(10) unsigned NOT NULL DEFAULT '0',
  `ExtData` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '扩展字段，用于内部计算记录，如1表示0829给玩家补偿仙露/器魂需求',
  `TotalRMB` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '总共充值金额，单位分',
  `FlowerSum` int(11) NOT NULL DEFAULT '0',
  `LastLoginTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `LastLogoffTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `TodayFirstLoginTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `RecvRankEncTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `CourageMedal` bigint(20) NOT NULL DEFAULT '0',
  `CreateTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `UpdateTime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`PlayerID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

use logdb;

-- ----------------------------
-- Table structure for `oprecord`
-- ----------------------------
DROP TABLE IF EXISTS `oprecord`;
CREATE TABLE `oprecord` (
  `ID` int(10) unsigned NOT NULL,
  `PlayerID` int(10) unsigned NOT NULL,
  `ModuleType` smallint(5) unsigned NOT NULL,
  `OpType` smallint(5) unsigned NOT NULL,
  `OpValue` int(10) unsigned NOT NULL,
  `OpTime` datetime NOT NULL,
  `AfterOpValue` bigint(20) unsigned NOT NULL,
  `Param1` bigint(20) unsigned NOT NULL,
  `Param2` bigint(20) unsigned NOT NULL,
  `Param3` bigint(20) unsigned NOT NULL,
  `Param4` bigint(20) unsigned NOT NULL,
  `PlayerLevel` smallint(5) unsigned NOT NULL,
  `VipLevel` smallint(6) NOT NULL,
  `Comment` varchar(128) NOT NULL DEFAULT '',
  PRIMARY KEY (`ID`),
  KEY `IX1` (`ModuleType`,`OpType`,`OpTime`),
  KEY `IX2` (`PlayerID`,`ModuleType`,`OpTime`),
  KEY `IX3` (`PlayerID`,`ModuleType`,`OpType`,`OpTime`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of oprecord
-- ----------------------------


select count(1) as "oprecord count" from oprecord;